import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Button, Alert } from 'reactstrap';
import axios from 'axios';
import Header from '../components/header/Header';
import Footer from '../components/footer/Footer';
import MesaCard from './MesaCard';
import './reservas.css';

const MesasPack = () => {
    const [sucursal, setSucursal] = useState(1);
    const [mesas, setMesas] = useState([]);
    const [fechaConsulta, setFechaConsulta] = useState('');
    const [horaInicio, setHoraInicio] = useState('');
    const [horaFin, setHoraFin] = useState('');
    const [error, setError] = useState(null); // Estado para manejar errores

    const fetchMesas = async () => {
        try {
            // Limpiar cualquier error previo
            setError(null);

            // Obtener mesas por sucursal seleccionada usando la API proporcionada
            const responseMesas = await axios.get(`https://federico-fazbear.onrender.com/api/mesa/sucursal/${sucursal}`);
            let mesasData = responseMesas.data.mesas;

            // Verificar disponibilidad de las mesas llamando a la API de verificación
            if (fechaConsulta && horaInicio && horaFin) {
                const responseDisponibilidad = await axios.post('https://federico-fazbear.onrender.com/api/mesasdisponibles/verificar', {
                    fechaConsulta: fechaConsulta,
                    horaInicio: horaInicio,
                    horaFin: horaFin
                });

                const mesasOcupadas = responseDisponibilidad.data.result.map(m => m.codigo_mesa);

                // Actualizar el estado de las mesas según su disponibilidad
                mesasData = mesasData.map(mesa => ({
                    ...mesa,
                    disponible: !mesasOcupadas.includes(mesa.codigo_mesa)
                }));
            }

            setMesas(mesasData);
        } catch (error) {
            console.error("Error fetching mesas or checking availability:", error);
            setError("Error al cargar las mesas. Por favor, inténtalo de nuevo.");
        }
    };

    // Usar el botón para realizar la consulta de mesas
    const handleBuscarMesas = () => {
        fetchMesas();
    };

    useEffect(() => {
        fetchMesas(); // Cargar mesas al inicio
    }, [sucursal]);

    return (
        <>
            <Header />
            <section>
                <Container>
                    <Row>
                        <Col lg="12" className="text-center mb-4">
                            <h3 className="mesas__title">Mesas Disponibles</h3>
                        </Col>
                        <Col lg="12" className="text-center mb-5">
                            <div className="filters">
                                <select onChange={(e) => setSucursal(e.target.value)}>
                                    <option value="1">Sucursal Central</option>
                                    <option value="2">Sucursal Norte</option>
                                </select>
                                <input
                                    type="date"
                                    value={fechaConsulta}
                                    onChange={(e) => setFechaConsulta(e.target.value)}
                                    placeholder="Fecha"
                                />
                                <input
                                    type="time"
                                    value={horaInicio}
                                    onChange={(e) => setHoraInicio(e.target.value)}
                                    placeholder="Hora de Inicio"
                                />
                                <input
                                    type="time"
                                    value={horaFin}
                                    onChange={(e) => setHoraFin(e.target.value)}
                                    placeholder="Hora de Fin"
                                />
                                <Button color="primary" onClick={handleBuscarMesas}>
                                    Buscar Mesas
                                </Button>
                            </div>
                        </Col>
                        <Col lg="12">
                            {error && <Alert color="danger">{error}</Alert>}
                            <div className="map-container">
                                {mesas.length > 0 ? (
                                    mesas.map(mesa => (
                                        <MesaCard
                                            key={mesa.id}
                                            mesa={mesa}
                                        />
                                    ))
                                ) : (
                                    <p className="text-center">No hay mesas disponibles para los filtros seleccionados.</p>
                                )}
                            </div>
                        </Col>
                    </Row>
                </Container>
            </section>
            <Footer />
        </>
    );
}

export default MesasPack;
